import React from 'react';

const agentData = {
  타격대: ['네온', '레이나', '레이즈', '아이소', '요루', '웨이레이', '제트', '피닉스'],
  척후대: ['게코', '브리치', '소바', '스카이', '케이오', '테호', '페이드'],
  감시자: ['데드록', '바이스', '사이퍼', '세이지', '체임버', '킬조이'],
  전략가: ['바이퍼', '브림스톤', '아스트라', '오멘', '클로브', '하버'],
};

function AgentsPage() {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>발로란트 요원 목록</h1>
      {Object.entries(agentData).map(([role, agents]) => (
        <div key={role}>
          <h2 style={styles.roleTitle}>{role}</h2>
          <div style={styles.grid}>
            {agents.map((name) => (
              <div key={name} style={styles.card}>
                <img
                  src={`/agents/${name}.png`}
                  alt={name}
                  style={styles.image}
                />
                <div style={styles.name}>{name}</div>
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
}

const styles = {
  container: {
    padding: '60px 20px',
    backgroundColor: '#f5f5f5',
    color: '#333',
    minHeight: '100vh',
    textAlign: 'center',
  },
  title: {
    fontSize: '36px',
    marginBottom: '40px',
  },
  roleTitle: {
    fontSize: '28px',
    margin: '40px 0 20px',
    color: '#111',
  },
  grid: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: '30px',
  },
  card: {
    backgroundColor: '#fff',
    borderRadius: '10px',
    padding: '10px',
    width: '250px',
    boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
    textAlign: 'center',
  },
  image: {
    width: '250px',
    height: '250px',
    objectFit: 'cover',
    borderRadius: '10px',
  },
  name: {
    marginTop: '10px',
    fontSize: '18px',
    fontWeight: 'bold',
  },
};

export default AgentsPage;
